import styled from "styled-components";

const InputStyled = styled.input`
  width: 85%;
  height: 4%;
  margin-top: 0.5em;
  border: none;
  border-top: 1px solid #353b48;
  font-size: 1em;
  &:focus {
    outline: none;
  }
`;
export default InputStyled;
